def _partially_consume_prefix(self, prefix, column):
        lines = []
        current_line = ""
        current_column = 0
        for char in prefix:
            if char == '\n':
                if current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]
                lines.append(current_line + '\n')
                current_line = ""
                current_column = 0
            elif char == ' ':
                current_column += 1
                current_line += char
            elif char == '\t':
                current_column += 4
                current_line += char
            else:
                # indent is finished
                if current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]
                current_line += char
                for c in current_line:
                    if c == ' ':
                        current_column += 1
                    elif c == '\t':
                        current_column += 4
                    else:
                        break
        return ''.join(lines), current_line
